Подробнее о балльно-рейтинговой системе: Оценка это ваши баллы за практическую часть + домашние задания + экзамен Без успешной сдачи экзамена вы не можете получить оценку, то есть: int score = practice + hw + exam;
int grade = (exam > 0) ? score : std::min(score, 59);
// grade -> de.ifmo При необходимости система может меняться в течение семестра в любую из сторон Разбалловка Практика - 20 баллов. Несколько небольших заданий, которые вам расскажут преподаватели на отдельной паре, напишут какую-то часть кода, ответят на вопросы. Выполняются обычно за 2-5 дней, отправка любых посылок по практикам после дедлайна невозможна. Домашние задания - 66 баллов. Задания, которые будут выдавать в течение семестра. Для каждой будет отдельный дедлайн, за просрочку сдачи которого будет штраф. Экзамен - 20 баллов. Состоит из практической и теоретической части. В практической вы за несколько часов пишете задание, которое оценит преподаватель, а в теоретическом - отвечаете на вопросы по курсу. Чтобы получить оценку за курс, нужно сдать хотя бы на минимум каждую из частей экзамена. Итого 106 баллов , оценки по баллам такие же как в ЦДО. Баллы за ДЗ считаются по формуле \[ R = S \cdot B \cdot \left(0.6 + \frac{0.4}{C} \right)\] \[ C = 1 + 0.35 \cdot \left\lceil \frac{d}{3} \right\rceil \] \( B \) — максимальный балл за задачу \( S \) — ваша оценка за задачу \( d \) — кол-во дней прошедших после дедлайна до вашей посылки Оценки за ДЗ . Для простоты переведены в символьную систему Symbol Description Score + Задание выполнено 1 +- Есть недочеты 0.8 -+ Много недочетов 0.6 - Плохо 0 Штрафы распространяются на любые посылки после дедлайна, даже правки. Штрафа на количество посылок нет. Сдать ДЗ с первого раза скорее всего не получится и это нормально. Мы все тут ещё учимся. Проверка занимает достаточно ненулевое время. Тот факт, что вы сдали до дедлайна, не означает, что вы успеете и исправить до него. Чаще всего чем ближе дедлайн, тем больше время проверки в силу увеличивающейся очереди посылок. Рекомендуется сдавать как можно раньше, чтобы получить больше шансов на проверки правок до дедлайна
